import React, { useState, useEffect } from "react";
import axios from "axios";
import { Link } from "react-router-dom";

const Head = () => {
  const [click, setClick] = useState(false);
  const [userProfile, setUserProfile] = useState(null);

  // Retrieve the email from local storage
  const userEmail = localStorage.getItem("userEmail");

  const handleResetClick = () => {
    // Clear the user's email from local storage
    localStorage.removeItem("userEmail");
    window.location.reload();
  };

  useEffect(() => {
    // Fetch all users for the UserProfile component
    axios
      .get("http://localhost:8000/users")
      .then((response) => {
        setUserProfile(response.data.find((user) => user.email === userEmail));
      })
      .catch((error) => {
        console.error("Error fetching user data:", error);
      });
  }, [userEmail]);

  return (
    <>
      <section className="head">
        <div className="container flexSB">
          <div className="logo">
            <Link
              className="
             text-[40px] font-bold text-[white]"
              to="/"
            >
              AppTechTell
            </Link>
            <span></span>
          </div>

          <div className="social">
            <a href="https://www.facebook.com" target="_blank">
              <i className="fab fa-facebook-f icon"></i>
            </a>

            <a href="https://www.instagram.com" target="_blank">
              <i className="fab fa-instagram icon"></i>
            </a>

            <a href="https://www.twitter.com" target="_blank">
              <i className="fab fa-twitter icon"></i>
            </a>

            <a href="https://www.youtube.com" target="_blank">
              <i className="fab fa-youtube icon"></i>
            </a>

            <a
              target="_blank"
              className=" hover:bg-white bg-[#1eb2a6] text-[white] hover:text-[#1eb2a6]  p-3 rounded-2xl ml-2 hover:scale-105 ease-in-out  duration-300"
              href="https://discord.gg/ju7nHjUR"
            >
              Query Room
            </a>

            <div>
              <Link to="/login">Login</Link>
            </div>
          </div>
        </div>
      </section>
    </>
  );
};

export default Head;
